import React from 'react';

const Table = () => {
    return (
        <table className="table">
        <thead>
          <tr>
            <th>Номер</th>
            <th>Дата</th>
            <th>Имя</th>
            <th>Количество</th>
            <th>Дистанция</th>
          </tr>
        </thead>
        <tbody>
          {
            data.map(
              item => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.date.slice(0, 10)}</td>
                  <td>{item.name}</td>
                  <td>{item.count}</td>
                  <td>{item.distance}</td>
                </tr>
              )
            )
          }
        </tbody>
      </table>
    );
}

export default Table;
